import React, { Fragment } from "react";
import { Link } from "react-router-dom";

class Navbar extends React.Component{
    constructor(props){
        super(props)
    }

    render(){
        return(
            <Fragment>
                <nav className="navbar navbar-success bg-successnavbar-expand-sm">
                    <div className="container">
                        <Link to='/' className="navbar-brand text-dark">BigBasket</Link>
                        <Link to='/home' className="navbar-brand text-dark">Home</Link>
                        <Link to='/ProductList' className="navbar-brand text-dark">ProductList</Link>
                        <Link to='/' className="navbar-brand text-dark">ProductAdmin</Link>
                        <Link to='/' className="navbar-brand text-dark">UpdateProduct</Link>
                        <Link to='/' className="navbar-brand text-dark">CreateProduct</Link>


                    </div>
                </nav>
            </Fragment>
        )
    }
}

export default Navbar
